    const newTweens = [
      gsap.to("#main_cd", 15, {
        rotation: "360",
        ease: Linear.easeNone,
        transformOrigin: "center",
        repeat: -1
      }),
      gsap.to(".cls-14", 15, {
        rotation: "-360",
        ease: Linear.easeNone,
        transformOrigin: "center",
        repeat: -1
      })
    ];

    setTweens(newTweens);

    const handleMouseEnter = () => {
      gsap.to(tweens[0], { timeScale: 0.3, duration: 1 });
      gsap.to(tweens[1], { timeScale: 0.3, duration: 1 });
    };

    const handleMouseLeave = () => {
      gsap.to(tweens[0], { timeScale: 1, duration: 1 });
      gsap.to(tweens[1], { timeScale: 1, duration: 1 });
    };

    var svg = svgRef.current
    svg.addEventListener("mouseenter", handleMouseEnter);
    svg.addEventListener("mouseleave", handleMouseLeave);

    return () => {
      svg.removeEventListener('mouseenter', handleMouseEnter);
      svg.removeEventListener('mouseleave', handleMouseLeave);
      tweens.forEach(tween => tween.kill());
    };

